def fundsCheckRetryDaysPayments = context.expand( '${Properties#fundsCheckRetryDaysPayments}' )
def paymentStatus = 'LAFU'
if(fundsCheckRetryDaysPayments=='0' || fundsCheckRetryDaysPayments=='1'){
	paymentStatus = 'STOL'
}

testRunner.testCase.testSteps['Properties'].setPropertyValue('STOLPaymentStatus',paymentStatus);

def strHost = context.expand( '${#Project#EBSHost}' )
def strUsername = context.expand( '${#Project#UserName}' )
def strPassword = context.expand( '${#Project#Password}' )
def  intPort = context.expand( '${#Project#Port}' )
def marketType = context.expand( '${Properties#marketType}' )
marketType = marketType.toUpperCase()
def jobRunType = context.expand( '${Properties#jobRunType}' )
jobRunType = jobRunType.toUpperCase()

String env = testRunner.testCase.testSuite.project.getActiveEnvironmentName().toLowerCase()
env = env.toString().substring(2)

if (!(ServerConnect.Connect(strHost ,strUsername, strPassword, Integer.parseInt(intPort)) == "PASS"))
	assert false," Failed to conenct to linux server!!"
else
 assert true;

def nextDate =  new Date() ;
nextDate =java.time.LocalDateTime.now().format(java.time.format.DateTimeFormatter.ofPattern('yyyyMMdd'))

String shParameter = "pwhDueDateProcessing.sh classpath:spring/pwh-due-date-job-batch-context.xml pwhDueDateProcessing processLine='PE_INT_OUT' paymentStatuses='RFDD,LAFU' releaseDate=$nextDate lastOfDay='true' porType='CompletePOR' banksInProcess='4201' marketType='PM' 2>&1"
String CommandOutPut = ServerConnect.execBatchCommand(env , "pin" ,shParameter)	

ServerConnect.closeConnection()
def porSuccessMessage1 = 'Spring Boot'
def porSuccessMessage2 ='Spring Boot'

assert (CommandOutPut.trim() != "" && (CommandOutPut.contains(porSuccessMessage1) ||  CommandOutPut.contains(porSuccessMessage2))), "CommandLine OutPut having error!!, Executed command :" + CommandOutPut

def fundsCheckRetryDaysPayments = context.expand( '${Properties#fundsCheckRetryDaysPayments}' )

if (fundsCheckRetryDaysPayments != '0' && fundsCheckRetryDaysPayments != '1')
	{	  
	  int tempRetryDays = Integer.parseInt(fundsCheckRetryDaysPayments) -1
	  testRunner.testCase.testSteps['Properties'].setPropertyValue('fundsCheckRetryDaysPayments',tempRetryDays.toString());

	  testRunner.gotoStepByName('startLoop')

	}

def strHost = context.expand( '${#Project#EBSHost}' )
def strUsername = context.expand( '${#Project#UserName}' )
def strPassword = context.expand( '${#Project#Password}' )
def  intPort = context.expand( '${#Project#Port}' )
def marketType = context.expand( '${Properties#marketType}' )
marketType = marketType.toUpperCase()
def jobRunType = context.expand( '${Properties#jobRunType}' )
jobRunType = jobRunType.toUpperCase()

String env = testRunner.testCase.testSuite.project.getActiveEnvironmentName().toLowerCase()
env = env.toString().substring(2)

if (!(ServerConnect.Connect(strHost ,strUsername, strPassword, Integer.parseInt(intPort)) == "PASS"))
	assert false," Failed to conenct to linux server!!"
else
 assert true;

String shParameter = "pwhDueDateHandleStoppedDueToLackOfFundsLauncher.sh"
String CommandOutPut = ServerConnect.execBatchCommand(env , "pin" ,shParameter)	

ServerConnect.closeConnection()
def porSuccessMessage1 = 'Spring Boot'
def porSuccessMessage2 ='Spring Boot'

assert (CommandOutPut.trim() != "" && (CommandOutPut.contains(porSuccessMessage1) ||  CommandOutPut.contains(porSuccessMessage2))), "CommandLine OutPut having error!!, Executed command :" + CommandOutPut

